css:
.ink-compiled-code-container .ink-compiled-header {
  padding: 0.5em;
}
.ink-compiled-code-container .ink-compiled-code {
  background-color: #282c34;
  color: #abb2bf;
  font-family: var(--editor-font-family);
  font-size: var(--editor-font-size);
  line-height: var(--editor-line-heith);
  white-space: pre-wrap;
}
.ink-compiled-code-container .ink-compiled-code .ink-compiled-line-number {
  min-width: 3.5em;
  border-right: 1px solid #181a1f;
  display: table-cell;
  text-align: right;
  padding: 0 0.5em;
}
.ink-compiled-code-container .ink-compiled-code .ink-compiled-line-content {
  display: table-cell;
  padding: 0 0.5em;
}
